import React from 'react';
import { FormControlLabel, Checkbox } from '@mui/material';

const DateCreated = ({ date }) => {
  

  return (
    <div>
      <span>{date}</span>
      <FormControlLabel
        control={<Checkbox/>}
        label="Сортировка"
      />
    </div>
  );
};

export default DateCreated;
